## Printer settings

[printer]
kinematics: corexz
max_velocity: 300
max_accel: 10000
max_accel_to_decel: 10000
max_z_velocity: 50
max_z_accel: 1000
square_corner_velocity: 5

## Stepper settings

[stepper_x]
step_pin: P2.2
dir_pin: P2.6
enable_pin: !P2.1
step_distance: 0.0125
endstop_pin: ^P1.29
position_endstop: 250
position_min: 0
position_max: 250
homing_speed: 70
homing_positive_dir: true

[tmc2209 stepper_x]
uart_pin: P1.17
tx_pin: P4.29
microsteps: 16
run_current: 0.8
hold_current: 0.3
interpolate: True
stealthchop_threshold: 0

[stepper_y]
step_pin: P0.19
dir_pin: !P0.20
enable_pin: !P2.8
step_distance: 0.0125
endstop_pin: ^P1.27
position_endstop: 247
position_min: 0
position_max: 250
homing_speed: 70
homing_positive_dir: true

[tmc2209 stepper_y]
uart_pin: P1.15
tx_pin: P1.16
microsteps: 16
run_current: 0.8
hold_current: 0.3
interpolate: true
stealthchop_threshold: 0

[stepper_z]
step_pin: P0.22
dir_pin: !P2.11
enable_pin: !P0.21
step_distance: .0125
#endstop_pin: probe:z_virtual_endstop
endstop_pin: ^P1.28
position_endstop: 0.0
position_max: 250
homing_speed: 40
second_homing_speed: 5
position_min: -3.0

[tmc2209 stepper_z]
uart_pin: P1.10
tx_pin: P1.14
microsteps: 16
run_current: 0.8
hold_current: 0.3
interpolate: True
stealthchop_threshold: 0

## Extruder settings

[extruder]
#max_extrude_only_distance: 100.0
max_extrude_cross_section: 50
max_extrude_only_distance: 700.00
step_pin: P2.13
dir_pin: P0.11
enable_pin: !P2.12
step_distance: 0.00242
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: P2.7
pressure_advance: 0.045
pressure_advance_smooth_time: 0.040
sensor_type: PT1000
pullup_resistor: 1000
sensor_pin: P0.25
min_temp: 0
max_temp: 270

[tmc2209 extruder]
uart_pin: P1.8
tx_pin: P1.9
microsteps: 16
run_current: 0.8
hold_current: 0.4
interpolate: True

[firmware_retraction]
retract_length: 0.75
retract_speed: 30
unretract_extra_length: 0
unretract_speed: 25

## Bed settings

[bed_mesh]
speed: 150
horizontal_move_z: 10
mesh_min: 25,35.0
mesh_max: 225.0,220
probe_count: 6,6
algorithm: bicubic
fade_start: 1
fade_end: 10
fade_target: 0

[heater_bed]
heater_pin: P2.5
sensor_type: ATC Semitec 104GT-2
sensor_pin: P0.23
min_temp: 0
max_temp: 130

[verify_heater heater_bed]
max_error: 180
check_gain_time: 120
hysteresis: 15
heating_gain: 2

